import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { DropdownButton, Dropdown } from 'react-bootstrap';
import { Link } from 'react-router-dom';



const Targets = () => {
  const handleButtonClick = (buttonNumber) => {
    console.log(`Button ${buttonNumber} clicked!`);
    // You can add your desired logic for handling button clicks here
  };

  return (
    <div
      className="container-fluid bg-secondary d-flex justify-content-center align-items-center"
      role="group"
      aria-label="Button group with nested dropdown"
      style={{ height: '90vh' }}
    >
      <DropdownButton
        id="dropdown-basic-button"
        title="Please Select A Target"
        variant="danger"
        size="lg"
      >
        <Dropdown.Item>
          <Link role = "button" to="/Davis" class="btn btn-white" style={{ textDecoration: 'none', color: 'inherit' }}>
            Davis
          </Link>
        </Dropdown.Item>

        <Dropdown.Item>
          <Link role = "button" to="/Maow" class="btn text-black btn-white" style={{ textDecoration: 'none', color: 'inherit' }}>
            Maow
          </Link>
        </Dropdown.Item>
      </DropdownButton>

    </div>
  );
};

export default Targets;
